                  '<p>Die Metadaten liegen im JSON-Format vor (nicht durchsuchbar). Sie werden dem Prompt für das LLM hinzugefügt, wenn Chunks dieses Dokuments im Prompt enthalten sind.</p>\n  <p>Beispiele:</p>\n  <b>Die Metadaten sind:</b><br>\n  <code>\n    {\n        "Author": "Alex Dowson",\n        "Date": "2024-11-12"\n    }\n  </code><br>\n  <b>Der Prompt wird sein:</b><br>\n  <p>Dokument: the_name_of_document</p>\n  <p>Autor: Alex Dowson</p>\n  <p>Datum: 2024-11-12</p>\n  <p>Relevante Fragmente wie folgt:</p>\n  <ul>\n  <li>  Hier ist der Chunk-Inhalt....</li>\n  <li>  Hier ist der Chunk-Inhalt....</li>\n  </ul>\n  ',
