                qa: '\n      <p>\n      このチャンク方法は<b>XLSX</b>および<b>CSV/TXT</b>ファイル形式をサポートします。\n    </p>\n    <li>\n      <b>XLSX</b>形式のファイルには、ヘッダーのない2つの\n      列が必要です： 1つは質問の列でもう1つは回答の列です\n      （質問列が先行）。複数のシートも可能です。\n      \n    </li>\n    <li>\n     <b>CSV/TXT</b>形式のファイルは、TABで区切られたUTF-8エンコードである必要があります。\n    </li>\n    <p>\n      <i>\n          上記のルールに従わないテキスト行は無視され、\n          各Q&Aのペアは独立したチャンクとして扱われます。\n      </i>\n    </p>\n      ',
