                methodEmpty: '這將顯示知識庫類別的可視化解釋',
                book: '<p>支持的文件格式為<b>DOCX</b>、<b>PDF</b>、<b>TXT</b>。</p><p>\n        由於一本書很長，並不是所有部分都有用，如果是 PDF，\n        請為每本書設置<i>頁面範圍</i>，以消除負面影響並節省分析計算時間。</p>',
                laws: "<p>支持的文件格式為<b>DOCX</b>、<b>PDF</b>、<b>TXT</b>。</p><p>\n        法律文件有非常嚴格的書寫格式。我們使用文本特徵來檢測分割點。\n        </p><p>\n        chunk的粒度與'文章'一致，所有上層文本都會包含在chunk中。\n        </p>",
                manual:
                  '<p>僅支持<b>PDF</b>。</p><p>\n        我們假設手冊具有分層部分結構。我們使用最低的部分標題作為對文檔進行切片的樞軸。\n        因此，同一部分中的圖和表不會被分割，並且塊大小可能會很大。\n        </p>',
                naive:
                  '<p>支持的文件格式為<b>MD、MDX、DOCX、XLSX、XLS (Excel 97-2003)、PPT、PDF、TXT、JPEG、JPG、PNG、TIF、GIF、CSV、JSON、EML、HTML</b>。</p>\n        <p>此方法將簡單的方法應用於塊文件：</p>\n        <p>\n        <li>系統將使用視覺檢測模型將連續文本分割成多個片段。</li>\n        <li>接下來，這些連續的片段被合併成Token數不超過“Token數”的塊。</li></p>',
                paper:
                  '<p>僅支持<b>PDF</b>文件。</p><p>\n        如果我們的模型運行良好，論文將按其部分進行切片，例如<i>摘要、1.1、1.2</i>等。</p><p>\n        這樣做的好處是LLM可以更好的概括論文中相關章節的內容，\n        產生更全面的答案，幫助讀者更好地理解論文。\n        缺點是它增加了 LLM 對話的背景並增加了計算成本，\n        所以在對話過程中，你可以考慮減少‘<b>topN</b>’的設置。</p>',
                presentation:
                  '<p>支持的文件格式為<b>PDF</b>、<b>PPTX</b>。</p><p>\n        每個頁面都將被視為一個塊。並且每個頁面的縮略圖都會被存儲。</p><p>\n        <i>您上傳的所有PPT文件都會使用此方法自動分塊，無需為每個PPT文件進行設置。</i></p>',
                qa: '<p>\n      此塊方法支持<b> excel </b>和<b> csv/txt </b>文件格式。\n    </p>\n    <li>\n      如果文件是<b> excel </b>格式，則應由兩個列組成\n      沒有標題：一個提出問題，另一個用於答案，\n      答案列之前的問題列。多張紙是\n      只要列正確結構，就可以接受。\n    </li>\n    <li>\n      如果文件是<b> csv/txt </b>格式\n      以 UTF-8 編碼且用 TAB 作分開問題和答案的定界符。\n    </li>\n    <p>\n      <i>\n        未能遵循上述規則的文本行將被忽略，並且\n        每個問答對將被認為是一個獨特的部分。\n      </i>',
                resume:
                  "<p>支持的文件格式為<b>DOCX</b>、<b>PDF</b>、<b>TXT</b>。\n        </p><p>\n        簡歷有多種格式，就像一個人的個性一樣，但我們經常必須將它們組織成結構化數據，以便於搜索。\n        </p><p>\n        我們不是將簡歷分塊，而是將簡歷解析為結構化數據。作為HR，你可以扔掉所有的簡歷，\n        您只需與<i>'ragflow'</i>交談即可列出所有符合資格的候選人。\n        </p>\n          ",
                table:
                  "支持<p><b>XLSX</b>和<b>csv/txt</b>格式文件。</p><p>以下是一些提示： <ul> <li>对于Csv或Txt文件，列之间的分隔符为 <em><b>tab</b></em>。</li> <li>第一行必须是列标题。</li> <li>列标题必须是有意义的术语，以便我们的大語言模型能够理解。列举一些同义词时最好使用斜杠<i>'/'</i>来分隔，甚至更好使用方括号枚举值，例如 <i>“性別/性別（男性，女性）”</i>.<p>以下是标题的一些示例：<ol> <li>供应商/供货商<b>'tab'</b>顏色（黃色、紅色、棕色）<b>'tab'</b>性別（男、女）<b>'tab'</B>尺码（m、l、xl、xxl）</li> <li>姓名/名字<b>'tab'</b>電話/手機/微信<b>'tab'</b>最高学历（高中，职高，硕士，本科，博士，初中，中技，中专，专科，专升本，mpa，mba，emba）</li> </ol> </p> </li> <li>表中的每一行都将被视为一个块。</li> </ul>",
                picture:
                  '\n       <p>支持圖像文件。視頻即將推出。</p><p>\n        如果圖片中有文字，則應用 OCR 提取文字作為其文字描述。\n        </p><p>\n        如果OCR提取的文本不夠，可以使用視覺LLM來獲取描述。\n        </p>',
                one: '\n      <p>支持的文件格式為<b>DOCX、EXCEL、PDF、TXT</b>。\n        </p><p>\n        對於一個文檔，它將被視為一個完整的塊，根本不會被分割。\n        </p><p>\n        如果你要總結的東西需要一篇文章的全部上下文，並且所選LLM的上下文長度覆蓋了文檔長度，你可以嘗試這種方法。\n        </p>',
                knowledgeGraph:
                  '<p>支援的檔案格式為<b>DOCX、EXCEL、PPT、IMAGE、PDF、TXT、MD、JSON、EML</b>\n\n<p>文件分塊後，使用分塊擷取整個文件的知識圖譜和心智圖。此方法將簡單的方法應用於區塊檔案：\n連續的文字將被分割成多個片段，每個片段大約有 512 個令牌數。\n<p>接下來，區塊將傳送到LLM以提取知識圖譜和思維導圖的節點和關係。\n\n<p>請注意您需要指定的條目類型。</p>',
                tag: '<p>使用「Tag」分塊方法的知識庫用作標籤集。其他知識庫可以使用它來標記自己的塊，對這些知識庫的查詢也將使用此標籤集進行標記。</p>\n<p>使用「Tag」作為分塊方法的知識庫<b>不</b>參與 RAG 過程。</p>\n<p>標籤知識庫中的每個塊都是一個獨立的描述-標籤對。</p>\n\n<p>支援的檔案格式包括<b>XLSX</b>和<b>CSV/TXT</b>檔案格式。</p>\n<p>如果檔案是<b>XLSX</b>格式，則應包含兩欄，不帶標題：一欄用於標籤描述，另一欄用於標籤名稱，描述欄位於標籤欄之前。如果欄結構正確，則可以接受多個工作表。</p>\n<p>如果檔案是<b>CSV/TXT</b>格式，則必須使用UTF-8編碼，並使用TAB作為分隔符來分隔描述和標籤。</p>\n<p>標籤欄中，標籤之間用英文逗號分隔。</p>\n<i>不符合上述規則的文字行將被忽略。</i>\n',
